import React from 'react';
import {Component} from 'react';
import './operator.css';
function Operator(){
    return (
    <div className="operator">
      <div>+</div>
      <div>*</div>
      <div>-</div>
      <div>/</div>
    </div>
    )
}

export default Operator;
